import React, { useState } from 'react';
import { GoogleLogin } from '@react-oauth/google';
import { Button, Dialog, DialogActions, DialogContent, DialogTitle, TextField, Typography, Box } from '@mui/material';

function HomePage() {
  const [open, setOpen] = useState(false);
  const [isLogin, setIsLogin] = useState(true); // Stav pro přepínání mezi přihlášením a registrací

  const handleLoginSuccess = (credentialResponse) => {
    console.log('Přihlášení/Registrace úspěšná! Credential Response:', credentialResponse);
    // Zpracování přihlášení nebo registrace, např. poslání tokenu na server
  };

  const googleLogin = GoogleLogin({
    onSuccess: tokenResponse => console.log(tokenResponse),
    onError: error => console.log(error),
  });

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  return (
    <Box sx={{ p: 3 }}>
      <Typography variant="h4" gutterBottom>
        Vítejte na GymNest
      </Typography>
      <Button variant="outlined" onClick={handleClickOpen} sx={{ marginRight: 1 }}>
        Přihlásit se
      </Button>
      <Button variant="outlined" onClick={handleClickOpen}>
        Registrovat se
      </Button>
      <Dialog open={open} onClose={handleClose}>
        <DialogTitle>{isLogin ? "Přihlášení" : "Registrace"}</DialogTitle>
        <DialogContent>
          {isLogin ? (
            <>
              {/* Přihlašovací formulář */}
              <TextField
                autoFocus
                margin="dense"
                id="email-login"
                label="Emailová adresa"
                type="email"
                fullWidth
                variant="standard"
              />
              <TextField
                margin="dense"
                id="password-login"
                label="Heslo"
                type="password"
                fullWidth
                variant="standard"
              />
            </>
          ) : (
            <>
              {/* Registrační formulář */}
              <TextField
                autoFocus
                margin="dense"
                id="firstname"
                label="Jméno"
                type="text"
                fullWidth
                variant="standard"
              />
              <TextField
                margin="dense"
                id="lastname"
                label="Příjmení"
                type="text"
                fullWidth
                variant="standard"
              />
              <TextField
                margin="dense"
                id="email"
                label="Emailová adresa"
                type="email"
                fullWidth
                variant="standard"
              />
              <TextField
                margin="dense"
                id="password"
                label="Heslo"
                type="password"
                fullWidth
                variant="standard"
              />
            </>
          )}
          <GoogleLogin 
            onSuccess={handleLoginSuccess} 
            onError={() => console.log('Přihlášení/Registrace selhala')}
          />
        </DialogContent>
        <DialogActions>
          {/* Přepínací tlačítka a Zrušit */}
          <Button
            onClick={googleLogin} // Přidáme onClick událost pro spuštění Google přihlášení
            variant="contained"
            style={{ backgroundColor: '#4285F4', color: 'white' }} // Příklad stylizace tlačítka
          >
            {isLogin ? "Přihlásit se přes Google" : "Registrovat se přes Google"} {/* Změna textu tlačítka podle kontextu */}
          </Button>
        </DialogActions>
      </Dialog>
      <Typography variant="h6" sx={{ mt: 4 }}>
        Veřejné rozvrhy
      </Typography>
      {/* Zde by se zobrazil seznam veřejných rozvrhů */}
      <Typography variant="h6" sx={{ mt: 4 }}>
        Soukromé rozvrhy
      </Typography>
      {/* Po přihlášení zde budou zobrazeny soukromé rozvrhy */}
    </Box>
  );
}

export default HomePage;
